for i in range(0, len(list_of_lats), chunk_size):
    batch_lats = list_of_lats[i : i + chunk_size]
    batch_lons = list_of_lons[i : i + chunk_size]
    
    success = False
    while not success:
        try:
            print(f"Fetching batch: {i} to {i + len(batch_lats)}...")

            params = {
                "latitude": batch_lats,
                "longitude": batch_lons,
                "daily": ["temperature_2m_max", "temperature_2m_mean", "wind_speed_10m_mean", "wind_speed_10m_max", "precipitation_sum"],
                "forecast_days": 1,
            }

            responses = openmeteo.weather_api(url, params=params)

            batch_frames = []

            for response in responses:
                daily = response.Daily()
                daily_data = {
                    "date": pd.date_range(
                        start=pd.to_datetime(daily.Time(), unit="s", utc=True),
                        end=pd.to_datetime(daily.TimeEnd(), unit="s", utc=True),
                        freq=pd.Timedelta(seconds=daily.Interval()),
                        inclusive="left"
                    ),
                    "lat": response.Latitude(),
                    "lon": response.Longitude(),
                    "temperature_2m_max": daily.Variables(0).ValuesAsNumpy(),
                    "temperature_2m_mean": daily.Variables(1).ValuesAsNumpy(),
                    "wind_speed_10m_mean": daily.Variables(2).ValuesAsNumpy(),
                    "wind_speed_10m_max": daily.Variables(3).ValuesAsNumpy(),
                    "precipitation_sum": daily.Variables(4).ValuesAsNumpy(),
                }
                batch_frames.append(pd.DataFrame(data=daily_data))

            # Combine the batch and save to CSV
            if batch_frames:
                combined_batch_df = pd.concat(batch_frames, ignore_index=True)
                
                if not os.path.isfile(output_file):
                    combined_batch_df.to_csv(output_file, index=False)
                else:
                    combined_batch_df.to_csv(output_file, mode='a', header=False, index=False)

            print(f"Successfully saved batch {i}.")
            success = True
            time.sleep(2)

        except Exception as e:
            # print open-meteo error message
            print(f"\n--------------{i}----------------")
            print(e)
            print("---------------------------------\n")

            error_msg = str(e).lower()

            # check for rate limits
            if "minutely" in error_msg or "10054" in error_msg:
                print("Minutely limit hit. Waiting 65s...")
                time.sleep(65)

            elif "hourly" in error_msg:
                print("Hourly limit hit. Waiting 6 minutes...")
                time.sleep(360)

            elif "daily" in error_msg:
                print("Daily limit hit. Script stopping.")
                break

            else:
                print("Unexpected error. Waiting 10 seconds before retry...")
                time.sleep(10)


print(f"Done! All data saved to {output_file}")